sys_variable_value.value:
(function execute(inputs, outputs) { 
    var gcc = new GooglePersistentDiskUtils();
    gcc.validateInputVariables(inputs, outputs);
    gcc.validateMandatoryVariables(inputs, ['projectid', 'zone', 'instance']);
    gcc.maptoOutputFromInput(inputs, outputs, ['projectid', 'zone','instance']);
    var requestBody = {
    }
    if (inputs.labels.length > 0 && inputs["labels"][0]['key']) {
        var labels = {};
        inputs.labels.forEach(function(label) {
           if (label['key'])
            labels[label['key']] = label['value'];
        })
        requestBody.labels = labels;
    }
    outputs.requestbody = JSON.stringify(requestBody);
})(inputs, outputs);

